class Solution:


    def build_dfa(self, needle):

        map = {}

        chs = [chr(x) for x in range(ord('a'), ord('z')+1)]

        for c in chs:
            map[c] = [0] * len(needle)

        x = 0
        map[needle[0]][0] = 1
        for i in range(1, len(needle)):
            for c in chs:
                map[c][i] = map[c][x]

            map[needle[i]][i] = i+1
            x = map[needle[i]][x]
        return map

    def strStr(self, haystack: str, needle: str) -> int:
        if needle == '':
            return 0

        dfa = self.build_dfa(needle)

        j = 0
        for i in range(0, len(haystack)):
            j = dfa[haystack[i]][j]
            if j == len(needle):
                return i-j+1


        return -1


